import React, { useState, useEffect } from 'react'
import axios from 'axios'

const Projects = () => {

    const [ projects, setProjects ] = useState=([])

    const getProjects = () => {
        useEffect(() => {
            axios
                .get('https://api.github.com/repos/pennebakers/repos')
                .response(response => {
                    setProjects(response.data)
                })
        })
    }

    return(
        <h1>Projects</h1>
    )
}

export default Projects
